import React from 'react';
import { Route, Routes } from 'react-router-dom';
import App from './App';

const AppR = () => {
  return (
    <Routes>
        <Route path="/perfil" element={<App />}/>
        <Route path="/" element={<App />}/>
    </Routes>
  );
};

export default AppR;
